import { useState } from 'react';
import '../css/Popup.css';
import ItemImage from './ItemImage.js';

export default function Popup(
    {   inactive,
        state,
        receiveData,
        sendData
    }) {
    const closePopup=()=>{
        inactive(0);
    }
    const handleItemChange = ()=>{

    };
    let buy = <></>
    if(receiveData["buy_price"] == -1){
        buy = <div className=''>
            <input placeholder='Input buy price'/>
            <input placeholder='Input City buy'/>
        </div>
    }else{
        buy =  <div className=''>
            <p>{receiveData["buy_price"]}</p>
        </div>
    }
    let sell = <></>
    if(receiveData["sell_price"] == -1){
        sell = <div className=''>
            <input placeholder='Input sell price'/>
            <input placeholder='Input City sell'/>
        </div>
    }else{
        sell =  <div className=''>
            <p>{receiveData["sell_price"]}</p>
        </div>
    }
    let recipe_buy = []
    if(receiveData["recipe"] != undefined){
        receiveData["recipe"]["buy"].forEach(element => {
            if(element[3] == -1){
                recipe_buy.push(
                    <tr className='tr-height'>
                        <td className='d-flex p-0'>
                            <ItemImage class={"mini-img"} id={element[0]} ign={element[1]}/>
                            <h3 className='h3-head mt-auto mb-auto'>{element[1]}</h3>
                        </td>
                        <td className='position-relative p-0'>
                            <input className='inp-field' placeholder='craft'/>
                        </td>
                 
                        <td className='position-relative p-0'>
                            <input className='inp-field' placeholder='city buy'/>
                        </td>
                    </tr>
                );
            }
        });
    }
    let recipe_craft = []
    if(receiveData["recipe"] != undefined){
        receiveData["recipe"]["craft"].forEach(element => {
            if(element[3] == -1){
                recipe_craft.push(
                    <tr className='tr-height'>
                        <td className='d-flex p-0'>
                            <ItemImage class={"mini-img"} id={element[0]} ign={element[1]}/>
                            <h3 className='h3-head mt-auto mb-auto'>{element[1]}</h3>
                        </td>
                    
                        <td className='position-relative p-0'>
                            <input className='inp-field' placeholder='craft'/>
                        </td>
                 
                        <td className='position-relative p-0'>
                            <input className='inp-field' placeholder='city buy'/>
                        </td>
                    </tr>  
                );
            }
        });
    }
    return (
        <>
            <div className={`container-fluid panel-parent ${state==0?"d-none":""}`}>
                <div className='panel'>
                    <div className='container'>
                        <button className='btn close-btn' onClick={closePopup}>X</button>
                        <div className='row'>
                            <div className='col'> 
                                <ItemImage class={"img-head"} id={receiveData["id"]} ign={receiveData["ign"]}/>
                                <h1 className='h1-head'>{receiveData["ign"]}</h1>
                            </div>
                        </div>
                        <div className='row'>
                            <div className='col'> 
                                <div className='container'>
                                    <table className='table table-striped table-dark'>
                                        <thead>
                                            <th>
                                                <h2 className='h2-head'>Item</h2>
                                            </th>
                                            <th>
                                                <h2 className='h2-head'>Price Buy</h2>
                                            </th>
                                            <th>
                                                <h2 className='h2-head'>City buy</h2>
                                            </th>
                                        </thead>
                                        <tbody className='scroll'>
                                            {recipe_buy}
                                            {recipe_craft}    
                                        </tbody>
                                    </table>
                                </div>
                            </div>
                        </div>
                        <button className='btn btn-primary modify-btn' onClick={handleItemChange}>Modify</button>
                    </div>
                </div>
            </div>
        </>
    )

}
